"use strict";
const InputNode = require("../core/InputNode.js");
const THREE = require("three");
class Matrix4Node extends InputNode {
  constructor(value = new THREE.Matrix4()) {
    super("mat4");
    this.value = value;
    Object.defineProperty(this, "isMatrix4Node", { value: true });
  }
}
module.exports = Matrix4Node;
